import React from "react";
import FullCalendar from "@fullcalendar/react";
import dayGridPlugin from "@fullcalendar/daygrid";

export default function Aside() {
return (
    <div className="left-parts">
    <div className="pt-info">
        <p>患者情報</p>
        <button className="edit-button">編集</button>
    </div>
    <div className="pt-info-detail">
        <p>患者番号-枝番</p>
        <p>フリガナ</p>
        <p>氏名</p>
        <p>保険種別</p>
        <p>保険割合</p>
    </div>
    <div className="calender">
        施術日
        <FullCalendar
        plugins={[dayGridPlugin]}
        initialView="dayGridMonth"
        locale="ja" // 日本語化
        events={[
            { title: "event 1", start: "2021-06-01" },
            // endに指定した日付は含まないので注意
            { title: "event 2", start: "2021-06-03", end: "2021-06-05" },
            {
            title: "event 3",
              start: "2021-06-07T10:00:00" // 時間を指定するときはISO 8601の形式で。
            }
        ]}　
        />
    </div>
    <div className="se-info"></div>
    </div>
  );
}
